row.EN-Gloss:
open to two or more interpretations; or of uncertain nature or significance; or (often) intended to mislead; "an equivocal statement";
    "the polling had a complex and equivocal (or ambiguous) message for potential female candidates"; "the officer's equivocal behavior increased the
    victim's uneasiness"; "popularity is an equivocal crown"; "an equivocal response to an embarrassing question"
